        alert("Password Dismatch")
      }

    let obj ={
        em: email.current.value,
        pas: pswd.current.value
      }
      signInWithEmailAndPassword(auth,obj.em,obj.pas)
      .then(()=>{
        alert("Success")
        nav('/')
      }).catch((err)=>{err})



    }
    return(
        <div>

                <form onSubmit={get}>
                    <label>Email</label>
                    <input type="email"/>
                    <br/><br/>
                    <label>Password</label>
                    <input type="password"/>
                    <br/><br/>
                    <button type="submit">Login</button>
                </form>
        </div>
    )
}
export default Login;
